import React from "react";
import Pagination from "react-bootstrap/Pagination";
import PageItem from "react-bootstrap/PageItem";

const NewsContent = () => {
  return (
    <div>
      <h1>News</h1>
      <Pagination>
        <PageItem>1</PageItem>
      </Pagination>
    </div>
  );
};

export default NewsContent;
